import React from 'react';
import './MottoComponent.css';

function MottoComponent() {
  return (
    <div className='motto-container'>
      <p className='motto-text'>Primum Non Desipere</p>
      <p className='motto-explanation'>
        This motto conveys our commitment to prioritizing wisdom and discernment in our actions and decisions, reflecting our pursuit of excellence and thoughtful consideration in all we do.
      </p>
    </div>
  );
}

export default MottoComponent;


/* <p className='motto-translation'>First, Do Not Act Foolishly</p> */
